import React from 'react';

function Home() {
  return (
    <main>
      <h2>환영합니다!</h2>
      <p>홈페이지에 오신 것을 환영합니다.</p>
          <Button size="large" onClick={navigateToPurchase}>
            회원가입
          </Button>
          
          <Button size="large" onClick={navigateToPurchase}>
            로그인
          </Button>
          
          <Button size="large" onClick={navigateToPurchase}>
            소개
          </Button>
          
    </main>
  );
}

export default Home;
